import React, {Component} from "react";
import axios from 'axios';

export default class ItemViewComponent extends Component{

    constructor(props) {
        super(props);
        this.items = [];
    }

    componentDidMount() {
        axios.get('http://localhost:3000/items')
            .then(res =>{
                this.items = res.data;
            });
    }

    tableData(){
        return this.items.map();
    }

    render() {
        return(
            <div>Item View</div>
        );
    }
}
